import Create from "./components/create";
import {
  BrowserRouter as Router,
  Route,
  BrowserRouter,
} from "react-router-dom";

function App() {
  return (


      <div className="main">
        <h2 className="main-header">Users Registration form</h2>
        <div>
          <Route exact path="/create" component={Create} />
        </div>
      </div>

  );
}

export default App;
